import React from "react";
import "./First.css";
import image from "./image-transform.jpg";
import { Container, Col } from "react-bootstrap";
const First = () => {
  return (
    <div>
      <Container fluid>
        <div className='row'>
          <div className=' col-lg-6 ' id='sec1'>
            <div>
            <h2 id='h'>
              Transform your
              <br />
              brand
            </h2>
            <p id="p">
              We are a full-service creative agency <br/>specializing in helping
              brands grow fast.<br/> Engage your clients through compelling<br/> visuals
              that do most of the marketing for you.
            </p>
              <span id="learnmore"> Learn more</span>
              </div>
          </div>
          <div className='col-lg-6 ' id="egg">
            <img src={ image} alt="image" />
          </div>
        </div>
      </Container>
    </div>
  );
};

export default First;
